	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-Project {
  display: flex;
  align-items: center;
  padding: 5px 10px;
  border-bottom: 1px solid #1b1d22;
}
.github-Project-path {
  flex: 1;
  margin-left: 10px;
}
.github-Project-avatarBtn {
  height: 23px;
  width: 23px;
  padding: 0;
  border-radius: 3px;
  background-color: #2e3138;
  border: none;
}
.github-Project-avatar {
  width: 23px;
  height: 23px;
  border-radius: 3px;
  color: transparent;
  overflow: hidden;
}
.github-Project-lock.btn {
  width: 40px;
  height: 20px;
  padding: 0;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: baseline;
  border: none;
  background-color: transparent;
  background-image: none;
}
.github-Project-lock.btn:active,
.github-Project-lock.btn:hover {
  background-color: transparent;
  background-image: none;
}
.github-Project .icon {
  padding: 0;
  margin: 0;
  line-height: 1em;
  fill: #9fa5b1;
}
.github-Project .icon:hover {
  fill: #d8dadf;
}
.github-Project .icon.icon-unlock {
  width: 21px;
  height: 17px;
  padding-left: 1px;
}
